import React, { Component } from 'react';
import Footer from '../../pageSettings/footer/Footer';
import Header from '../../pageSettings/header/Header';
import Navbar from '../navbar/Navbar';
import style from './adminHome.module.css';

export default class AdminHome extends Component {
  state={
    amountOfUsers:0,
    amountOfOpenQuestions:0,
    amountOfClosedQuestions:0,
    overallUserSatisfaction:0,
    professionalData:'professional data'

  }
  render() {
    return (
      <div className={style.adminHome}>
        <Navbar />
        <Header h1Heading='PC BUILDER ADMIN' />

        <section>
          <section>
            <h2>Amount of users connected to the system</h2>
            <p>{this.state.amountOfUsers}</p>
          </section>
          <section>
            <h2>Amount open questions</h2>
            <p></p>
          </section>
          <section>
            <h2>Amount close questions</h2>
            <p></p>
          </section>
          <section>
            <h2>Professional Data</h2>
            <p></p>
          </section>
          <section>
            <h2>Overall user satisfaction</h2>
            <p></p>
          </section>
        </section>

        <Footer />
      </div>
    );
  }
}
